import React from "react";
import { Card, Avatar } from "antd";

const UserProfile = () => {
    return (
        <Card
            actions={[
                <div key="twit">
                    <br /> 트윗
                </div>,
                <div key="followings">
                    <br />
                    트윗
                </div>,
                <div key="followers">
                    <br />
                    트윗
                </div>,
            ]}
        >
            <Card.Meta title="Zino" avatar={<Avatar></Avatar>}></Card.Meta>
        </Card>
    );
};

export default UserProfile;
